Statically Exported Webapps Statically exported ones are easy to package, because it is a matter of running npm build (or whatever your build script is) with the following NextJS settings // next.config.js
module.exports = { distDir: "dist", // an artitrary path for your export output: "export",
}; This will export a static website with a bunch of html files that you can then serve with nodePackages.serve or a webserver like nginx or apache. And that is the end of your worries for a statically exported website! No headache, just write a simple derivation, such as the one below # default.nix
{ buildNpmPackage, pkg-config, python3, ...
}:
buildNpmPackage { pname = "your-website"; version = "0.1"; src = ./.; # needs to be updated everytime you update npm dependencies npmDepsHash = "sha256-some-hash"; # some npm packages may need to be built from source, because nodejs is a *terrible* ecosystem nativeBuildInputs = [pkg-config python3]; # move exported website to $out postInstall = '' cp -rf dist/* $out '';
}

