If your website depends on API routes for some reasons, then Next will not allow you to do static export. Which means you need to run next start in some shape or form. While a systemd service is certainly a way of doing it (one that I do not recommend), a oci container works as well if not better. You can write a "simple" docker image for your oci container to use, such as the one below # dockerImage.nix
{ pkgs, inputs, ...
}: { dockerImage = pkgs.dockerTools.buildImage { config = { WorkingDir = "/your-website"; Cmd = ["npm" "run" "serve"]; }; name = "your-website"; tag = "latest"; fromImage = pkgs.dockerTools.buildImage { name = "node"; tag = "18-alpine"; }; copyToRoot = pkgs.buildEnv { name = "image-root"; paths = with pkgs; [ # this package is called from a flake.nix alongside the derivation for the website inputs.self.packages.${pkgs.stdenv.system}.your-website nodejs bash ]; pathsToLink = [ "/bin" "/your-website" ]; }; };
} Then, configure oci-containers module option to pick up the Docker image that you have built. virtualisation.oci-containers = { backend = "podman"; containers = { "website-container" = { autoStart = true; ports = [ "3000:3000" # bind container's port 3000 to the outside port 3000 for NextJS ]; extraOptions = ["--network=host"]; image = "your-website"; imageFile = inputs.website-flake.packages.${pkgs.stdenv.system}.dockerImage; }; };
}; After a rebuild, your system will provision the container and start it on port 3000. You can access it with your-server-ip:3000 in your browser, and even configure nginx to set up a reverse proxy to assign your domain. "example.com" = { locations."/".proxyPass = "http://127.0.0.1:3000";
}; This will assign your domain to your webserver, and allow outside visitors to view your "awesome" NextJS webapp.

